import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Views/Home";

function Routers() {
    return (
        <div>
            <BrowserRouter>
                <Routes>
                    <Route exact path='/' component={Home} />
                </Routes>
            </BrowserRouter>
        </div>
    )
}

export default Routers
